import React, { Component } from "react";
import Fade from "react-slideshow-image/lib/components/slideshow/fade";
import lehigh1 from "../images/lehigh-1.png";
import lehigh2 from "../images/lehigh-4.png";
import lehigh3 from "../images/lehigh-5.png";

const properties = {
  duration: 5000,
  transitionDuration: 2000,
  infinite: true,
  indicators: true,
  arrows: true
};

class Education extends Component {
  state = {
    slides: [
      { id: 1, value: lehigh1 },
      { id: 2, value: lehigh2 },
      { id: 3, value: lehigh3 }
    ]
  };

  render() {
    return (
      <div className="education">
        <div className="slide-container">
          <Fade {...properties}>
            {this.state.slides.map(slide => (
              <div key={slide.id} className="each-fade">
                <img
                  className="lehigh-photo"
                  src={slide.value}
                  alt="Lehigh University"
                />
              </div>
            ))}
          </Fade>
        </div>
        <div className="lehigh-text-container">
          <h3 className="lehigh-name">LEHIGH UNIVSERSITY</h3>
          <h3 className="lehigh-address">Bethlehem, Pennsylvania</h3>
          <br />
          <p className="lehigh-degree">
            2006 - 2010 | Bachelor of Science; <b>Finance</b>
          </p>
          <p className="lehigh-minor">
            <i>Minor in Psychology and Sociology</i>
          </p>
        </div>
      </div>
    );
  }
}

export default Education;
